import React from "react";

const WidgetList = ({widgets}) =>
<div>
  <h3>Widgets</h3>
  <ul>
    {
      widgets.map(widget =>
      <li key ={widget.id}>
        {widget.name} |
        {widget.type}
      </li>)
    }
  </ul>
</div>

const stateToPropMapper = (state) => ({
  widgets: state.widgetReducer.widgets
})

export default connect(stateToPropMapper)(widgetList)
